import { Heading, Paragraph } from "./components/Text";

import Feature from "./components/Feature";
import Hero from "./components/Hero";
import Section from "./components/Section";
import Strapline from "./components/Strapline";

function App() {
	return (
		<main>
			<Hero>
				<Heading style={{ width: "120%" }}>London's Stories...</Heading>
				<Paragraph>
					When people talk about how the gospel can change the world
					they start talking about <i>what God has done in London</i>.
				</Paragraph>
			</Hero>
			<Strapline>
				<b>Christian Heritage London</b> exists to draw attention to the
				advances of the gospel in this city&apos;s history in order to
				bless the present and shape the future.
			</Strapline>
			<Feature>
				<Feature.Title>London Walks</Feature.Title>
				<Feature.Image />
				<Feature.Description>
					We take small groups, families, church groups and others on
					walks and tours through some of the awesome London gospel
					stories.
				</Feature.Description>
				<Feature.Button>Book a walk</Feature.Button>
			</Feature>
		</main>
	);
}

export default App;
